export default class Rect {
    left: any;
    top: any;
    right: any;
    bottom: any;
    constructor(left?: any, top?: any, right?: any, bottom?: any);
    set(left: any, top: any, right: any, bottom: any): void;
    width(): number;
    height(): number;
    centerX(): number;
    centerY(): number;
    offset(dx: any, dy: any): this;
    copy(): Rect;
    equals(rect: any, epsilon: any): boolean;
    isValid(): boolean;
}
